import React from "react";
import Gdsctext from '../Assets/Gdsctext.png'
import rect from '../Assets/Rect.png'
import Grid from '../Assets/grid.png'
function Homepage() {
  return (
    <>
    <div >
      <img src={rect} alt="" id="bg-image"/>
      <img src={Gdsctext} alt="" id="gdsctext" />  
    </div>
      <img src={Grid} alt="" id="grid" />  

    </>
  );
}

export default Homepage;
